import * as React from 'react';
import { Card } from '@material-ui/core';
import { CardMedia } from '@material-ui/core';
import ButtonF from './components/Button.js';


import arcade from '../images/arcade.png';
import calcetto from '../images/calcetto.png';
import coding from '../images/coding.png';
import furnace from '../images/furnace.png';
import grill from '../images/grill.png';
import meeting from '../images/meeting.png';
import party from '../images/party.png';
import pingpong from '../images/pingpong.png';

const Immagini = () => {
        return (
            <>  
            <Card style={{width: '100px', height: '100px', margin: 'auto', backgroundColor:"grey", border: "5px", borderColor:"black", borderStyle:"solid", float:"left"}}> <ButtonF> <CardMedia
              component="img"
              image={arcade}
              alt="arcade"
              /> </ButtonF>
            </Card>
            <Card style={{width: '100px', height: '100px', margin: 'auto', backgroundColor:"grey", border: "5px", borderColor:"black", borderStyle:"solid", float:"left"}}> <Button> <CardMedia
              component="img"
              image={calcetto}
              alt="calcetto"
              /> </Button>
            </Card>
            <Card style={{width: '100px', height: '100px', margin: 'auto', backgroundColor:"grey", border: "5px", borderColor:"black", borderStyle:"solid", float:"left"}}> <Button> <CardMedia
              component="img"
              image={coding}
              alt="coding"
              /> </Button>
            </Card>
            <Card style={{width: '100px', height: '100px', margin: 'auto', backgroundColor:"grey", border: "5px", borderColor:"black", borderStyle:"solid", float:"left"}}> <Button> <CardMedia
              component="img"
              image={furnace}
              alt="furnace"
              /> </Button>
            </Card>
            <Card style={{width: '100px', height: '100px', margin: 'auto', backgroundColor:"grey", border: "5px", borderColor:"black", borderStyle:"solid", float:"left"}}> <Button> <CardMedia
              component="img"
              image={grill}
              alt="grill"
              /> </Button>
            </Card>
            <Card style={{width: '100px', height: '100px', margin: 'auto', backgroundColor:"grey", border: "5px", borderColor:"black", borderStyle:"solid", float:"left"}}> <Button> <CardMedia
              component="img"
              image={meeting}
              alt="meeting"
              /> </Button>
            </Card>
            <Card style={{width: '100px', height: '100px', margin: 'auto', backgroundColor:"grey", border: "5px", borderColor:"black", borderStyle:"solid", float:"left"}}> <Button> <CardMedia
              component="img"
              image={party}
              alt="party"
              /> </Button>
            </Card>
            <Card style={{width: '100px', height: '100px', margin: 'auto', backgroundColor:"grey", border: "5px", borderColor:"black", borderStyle:"solid", float:"left"}}> <Button> <CardMedia
              component="img"
              image={pingpong}
              alt="pingpong"
              /> </Button>
            </Card>
            </>
        );
}
 
export default Immagini;
